      "summary": "Caramel Macchiato Cake takes about <b>3 hours</b> from beginning to end. For <b>83 cents per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. One portion of this dish contains approximately <b>8g of protein</b>, <b>32g of fat</b>, and a total of <b>639 calories</b>. This recipe serves 10. 36 people have made this recipe and would make it again. A couple people really liked this dessert. This recipe from Foodista requires heavy whipping cream, coffee, granulated sugar, and gelatin powder. With a spoonacular <b>score of 17%</b>, this dish is rather bad. Similar recipes are <a href=\"https://spoonacular.com/recipes/caramel-macchiato-chocolate-cake-1619725\">Caramel Macchiato Chocolate Cake</a>, <a href=\"https://spoonacular.com/recipes/caramel-macchiato-chocolate-cake-1620255\">Caramel Macchiato Chocolate Cake</a>, and <a href=\"https://spoonacular.com/recipes/caramel-macchiato-gooey-cake-bars-490792\">Caramel Macchiato Gooey Cake Bars</a>.",
      "cuisines": [],
