      "summary": "Forget going out to eat or ordering takeout every time you crave Mexican food. Try making Corn-Crusted Fish Tacos With Jalapeno-Lime Sauce and Spicy Black Beans at home. This recipe serves 4 and costs $4.42 per serving. Watching your figure? This gluten free and pescatarian recipe has <b>1116 calories</b>, <b>51g of protein</b>, and <b>56g of fat</b> per serving. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. It works well as a pretty expensive main course. This recipe from Foodista requires black beans, cayenne pepper, limes, and monterey jack cheese. 11 person have tried and liked this recipe. Overall, this recipe earns an <b>outstanding spoonacular score of 94%</b>. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/corn-crusted-fish-tacos-with-jalapeno-lime-sauce-and-spicy-black-beans-552017\">Corn-Crusted Fish Tacos with Jalapeno-Lime Sauce and Spicy Black Beans</a>, <a href=\"https://spoonacular.com/recipes/corn-crusted-fish-tacos-with-jalapeno-lime-sauce-and-spicy-blac-6996\">Corn-crusted Fish Tacos With Jalapeno-lime Sauce And Spicy Blac</a>, and <a href=\"https://spoonacular.com/recipes/fish-tacos-with-jalapeno-lime-sauce-801518\">Fish Tacos with Jalapeno Lime Sauce</a>.",
