      "instructions": "<ol><li>Mix the mayo, lime juice and chopped jalapeno in a small bowl. Salt and pepper to taste, then put in the fridge.</li><li>Chop all veggies and set aside.</li><li>Add 1 tablespoon of oil to a small pan over medium-high heat. Add the green onions and allow them to saute for 1-2 minutes. Pour both cans of drained beans into the pan. Bring to a simmer and add the cumin, cayenne and  tsp. of salt. Squeeze a couple of lime wedges into the beans. Cook for 5 minutes longer. Cover and set aside. Top the beans with cheese when you are ready to serve them.</li><li>Heat a large skillet to high heat. Cut the fish into 1 x 3 inch strips. Drizzle oil on the fish, then salt and pepper both sides.</li><li>Pour the cornmeal into a pie pan. Roll the fish strips in cornmeal, shaking off the excess.</li><li>Add 2 tablespoons of oil to pan. When it is hot, cook half the fish strips 1-2 minutes per side, until opaque and flaky. The cooking time will depend on the thickness of the fish. Remove the fish from the pan and place on a paper towel-lined plate. Repeat.</li><li>Warm the tortillas in the microwave. Divide the fish between 8 tortillas. (You can double up the tortillas so they wont break!) Then top each with cabbage, tomatoes, cilantro and jalapeno-lime sauce. Serve with lime wedges and hot sauce, black beans on the side.</li></ol>",
