      "summary": "If you have about <b>45 minutes</b> to spend in the kitchen, Cornish Game Hen with Whisky and Cream Pan Sauce might be an amazing <b>gluten free and ketogenic</b> recipe to try. This recipe makes 4 servings with <b>789 calories</b>, <b>40g of protein</b>, and <b>68g of fat</b> each. For <b>$2.16 per serving</b>, this recipe <b>covers 19%</b> of your daily requirements of vitamins and minerals. It works well as a main course. A mixture of salt and pepper, to), dijon mustard, and a handful of other ingredients are all it takes to make this recipe so tasty. 4 people have made this recipe and would make it again. It is brought to you by Foodista. Overall, this recipe earns a <b>good spoonacular score of 45%</b>. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/soy-sauce-roasted-cornish-game-hen-ga-mai-ro-ti-14616\">Soy Sauce Roasted Cornish Game Hen (ga Mai Ro Ti)</a>, <a href=\"https://spoonacular.com/recipes/cornish-game-hen-with-double-cranberry-and-thyme-sauce-14589\">Cornish Game Hen with Double-Cranberry and Thyme Sauce</a>, and <a href=\"https://spoonacular.com/recipes/roasted-cornish-game-hen-568079\">Roasted Cornish Game Hen</a>.",
