      "instructions": "Instructions\n\nPreheat the oven to 350 degrees Fahrenheit.\n\nIn a medium bowl, blend together 2 cups of flour, 1/2 cup sugar, and softened butter. Press into a 9\" x 13\" pan. Bake for 15 – 20 minutes or until the crust is firm and golden brown.\n\nBlend 2 cups flour, 1/2 cup sugar, and softened butter in a mixing bowl. Press into a 9×13 pan. Bake for 15-20 minutes until the crust is golden brown.\n\nMix remaining sugar, flour, eggs, and whisk together well. Mix the lemon juice into the sugar, flour, and egg mixture.\n\nPour the lemon mixture over the baked crust and place back into the oven for an additional 20 minutes.\n\nRemove from the oven and allow them to cool and firm up before slicing and topping with powdered sugar.",
