      "summary": "The recipe Nutella Crepes and Ice Cream could satisfy your Mediterranean craving in roughly <b>45 minutes</b>. For <b>$1.09 per serving</b>, you get a dessert that serves 6. One portion of this dish contains around <b>11g of protein</b>, <b>25g of fat</b>, and a total of <b>633 calories</b>. 59 people have tried and liked this recipe. It will be a hit at your <b>Summer</b> event. This recipe from Afrolems requires flour, ice cream, butter milk, and eggs. With a spoonacular <b>score of 56%</b>, this dish is solid. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/italian-chestnut-crepes-with-nutella-cream-filling-gluten-free-522037\">Italian Chestnut Crepes with Nutella Cream filling {gluten free}</a>, <a href=\"https://spoonacular.com/recipes/confession-i-have-a-thing-for-crpeseasy-nutella-crpes-542495\">Confession I have a thing for crêpes…Easy Nutella Crêpes</a>, and <a href=\"https://spoonacular.com/recipes/ice-cream-crpes-83207\">Ice-cream Crêpes</a>.",
