      "summary": "You can never have too many dessert recipes, so give Brandy-Apple Mini Pies With Cornmeal Crust a try. This recipe makes 16 servings with <b>260 calories</b>, <b>2g of protein</b>, and <b>15g of fat</b> each. For <b>52 cents per serving</b>, this recipe <b>covers 3%</b> of your daily requirements of vitamins and minerals. 2 people were glad they tried this recipe. If you have brandy, tb, pumpkin pie spice, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 14%</b>. This score is not so amazing. Similar recipes include <a href=\"https://spoonacular.com/recipes/brandy-apple-mini-pies-with-cornmeal-crust-70318\">Brandy-apple Mini Pies With Cornmeal Crust</a>, <a href=\"https://spoonacular.com/recipes/brandy-apple-mini-pies-with-cornmeal-crust-1366811\">Brandy-Apple Mini Pies With Cornmeal Crust</a>, and <a href=\"https://spoonacular.com/recipes/brandy-apple-mini-pies-with-cornmeal-crust-104854\">Brandy-Apple Mini Pies With Cornmeal Crust</a>.",
