      "summary": "Flemish Style Asparagus Side Dish might be just the side dish you are searching for. This recipe makes 4 servings with <b>185 calories</b>, <b>8g of protein</b>, and <b>16g of fat</b> each. For <b>$1.46 per serving</b>, this recipe <b>covers 13%</b> of your daily requirements of vitamins and minerals. If you have asparagus, butter, flat parsley, and a few other ingredients on hand, you can make it. 3 people have made this recipe and would make it again. From preparation to the plate, this recipe takes around <b>25 minutes</b>. It is brought to you by Foodista. It is a good option if you're following a <b>gluten free, lacto ovo vegetarian, primal, and ketogenic</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 42%</b>. This score is solid. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/creamy-asparagus-risotto-side-dish-640590\">Creamy Asparagus Risotto Side Dish</a>, <a href=\"https://spoonacular.com/recipes/indian-style-pumpkin-side-dish-1597241\">Indian-Style Pumpkin Side Dish</a>, and <a href=\"https://spoonacular.com/recipes/indian-style-pumpkin-side-dish-643775\">Indian-Style Pumpkin Side Dish</a>.",
