      "instructions": "<ol><li>Peel the asparagus at its ends (not at the heads). Place the asparagus in a large saucepan. Fill with boiling water to cover the veggies completely. Add some salt.</li><li>Let the asparagus cook till tender. About 3 to 4 mins.</li><li>Chop some flat parsley into fine bits. Set aside.</li><li>Boil 3 eggs till hard and peel them.</li><li>Use a fork and mash the eggs.</li><li>Mash the eggs till they are fine crumbs. Set aside.</li><li>Melt butter in a saucepan.</li><li>Add the juice from 1/2 lemon.</li><li>Whisk the butter-lemon juice mixture constantly. Continue to boil gently for a couple of minutes.</li><li>Stir in the mashed eggs. Stir well to combine.</li><li>Add the chopped parsley.</li><li>Stir well to combine.</li><li>Plate the dish by laying a few stalks of the cooked asparagus on a plate and dish some sauce over them at the stalk ends.</li><li>Season with salt and pepper.</li><li>Serve warm.</li></ol>",
