      "summary": "You can never have too many hor d'oeuvre recipes, so give Powdered Buttermilk Beignets With Raspberry and Chocolate Dipping Sauce a try. This recipe serves 30 and costs 35 cents per serving. One portion of this dish contains around <b>3g of protein</b>, <b>6g of fat</b>, and a total of <b>136 calories</b>. 14 people have made this recipe and would make it again. This recipe from Foodista requires active yeast, raspberry jam, golden syrup, and canolan oil. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 26%</b>. This score is not so tremendous. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/raspberry-beignets-with-vanilla-dipping-sauce-299349\">Raspberry Beignets with Vanilla Dipping Sauce</a>, <a href=\"https://spoonacular.com/recipes/brandied-apricot-beignets-with-chocolate-dipping-sauce-48600\">Brandied Apricot Beignets with Chocolate Dipping Sauce</a>, and <a href=\"https://spoonacular.com/recipes/chocolate-filled-beignets-with-chocolate-dipping-sauce-484305\">Chocolate-filled Beignets with Chocolate Dipping Sauce</a>.",
