      "summary": "Need a <b>gluten free and lacto ovo vegetarian dessert</b>? Creme Brulee could be an awesome recipe to try. This recipe serves 8. For <b>96 cents per serving</b>, this recipe <b>covers 4%</b> of your daily requirements of vitamins and minerals. One serving contains <b>167 calories</b>, <b>3g of protein</b>, and <b>14g of fat</b>. Head to the store and pick up vanilla pod, whipping cream, milk, and a few other things to make it today. 7 people have made this recipe and would make it again. Only a few people really liked this Mediterranean dish. From preparation to the plate, this recipe takes approximately <b>4 hours</b>. It is brought to you by Foodista. Overall, this recipe earns a <b>rather bad spoonacular score of 16%</b>. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/white-chocolate-creme-brulee-with-strawberry-creme-brulee-kit-giveaway-487705\">White Chocolate Creme Brulee with Strawberry {Creme Brulee Kit Giveaway}</a>, <a href=\"https://spoonacular.com/recipes/creme-caramel-creme-brulee-pots-de-creme-572903\">Creme Caramel, Creme Brulee, Pots de Creme</a>, and <a href=\"https://spoonacular.com/recipes/crme-brle-590250\">Crème Brûlée</a>.",
