      "summary": "Panna Cotta with Raspberry and Orange Sauce is a dessert that serves 6. One serving contains <b>396 calories</b>, <b>8g of protein</b>, and <b>27g of fat</b>. For <b>$1.43 per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. It is a good option if you're following a <b>gluten free</b> diet. This recipe from Foodista has 18 fans. A few people really liked this Mediterranean dish. If you have half and half, orange juice, vanilla, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes around <b>45 minutes</b>. Overall, this recipe earns a <b>rather bad spoonacular score of 34%</b>. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/ghostly-panna-cottas-with-ghastly-saucepanna-cotta-with-cranberry-orange-sauce-343832\">Ghostly Panna Cottas with Ghastly Sauce(Panna Cotta with Cranberry-Orange Sauce)</a>, <a href=\"https://spoonacular.com/recipes/panna-cotta-with-raspberry-sauce-83243\">Panna Cotta With Raspberry Sauce</a>, and <a href=\"https://spoonacular.com/recipes/daring-bakers-challenge-vanilla-bean-blood-orange-panna-cotta-with-orange-allspice-caramel-sauce-and-orange-cardamom-hazelnut-dark-chocolate-florentines-gluten-free-51204\">Daring Bakers’ Challenge: Vanilla Bean & Blood Orange Panna Cotta with Orange Allspice Caramel Sauce and Orange Cardamom Hazelnut Dark Chocolate Florentines (gluten free)</a>.",
