      "summary": "My \"Secret\" Bolognese Sauce is a <b>gluten free and dairy free</b> recipe with 12 servings. One serving contains <b>505 calories</b>, <b>29g of protein</b>, and <b>33g of fat</b>. For <b>$2.76 per serving</b>, this recipe <b>covers 26%</b> of your daily requirements of vitamins and minerals. 27 people have tried and liked this recipe. A mixture of parsley, ground veal, ground pork, and a handful of other ingredients are all it takes to make this recipe so yummy. It works well as a budget friendly sauce. It is brought to you by Foodista. From preparation to the plate, this recipe takes around <b>45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 72%</b>, which is pretty good. Try <a href=\"https://spoonacular.com/recipes/the-secret-to-authentic-italian-bolognese-sauce-1039949\">The Secret to Authentic Italian Bolognese Sauce</a>, <a href=\"https://spoonacular.com/recipes/rag-alla-bolognese-bolognese-sauce-481414\">Ragù alla bolognese (Bolognese Sauce)</a>, and <a href=\"https://spoonacular.com/recipes/bolognese-sauce-ragu-bolognese-12250\">Bolognese Sauce (ragu Bolognese)</a> for similar recipes.",
