      "summary": "Gingerbread Mummies might be a good recipe to expand your hor d'oeuvre repertoire. One serving contains <b>216 calories</b>, <b>2g of protein</b>, and <b>6g of fat</b>. This recipe serves 18. For <b>30 cents per serving</b>, this recipe <b>covers 4%</b> of your daily requirements of vitamins and minerals. 40 people have tried and liked this recipe. It will be a hit at your <b>Christmas</b> event. It is brought to you by Foodista. From preparation to the plate, this recipe takes around <b>45 minutes</b>. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. Head to the store and pick up butter, milk, ground nutmeg, and a few other things to make it today. All things considered, we decided this recipe <b>deserves a spoonacular score of 21%</b>. This score is rather bad. <a href=\"https://spoonacular.com/recipes/gingerbread-mummies-1544003\">Gingerbread Mummies</a>, <a href=\"https://spoonacular.com/recipes/marshmallow-mummies-521064\">Marshmallow Mummies</a>, and <a href=\"https://spoonacular.com/recipes/yummy-mummies-109761\">Yummy Mummies</a> are very similar to this recipe.",
