      "instructions": "<ol><li>Slice the kale stems into thin pieces and the leaves into larger strips. Heat a large, deep pan to medium-high.</li><li>Add the bacon a cook 3-4 minutes.  Then add the shallots and cook until soft3 more minutes.</li><li>Next add the garlic, and kale STEMS.</li><li>Cook another 4-5 minutes before adding the leaves.  Toss until wilted over the heat. Add the soy sauce, vinegar, then salt and pepper to taste.  Keep warm.</li><li>Heat an iron skillet to high.  Dry the scallops thoroughly, then salt and pepper.</li><li>Add the oil to the pan and swirl around.  When it starts to smoke, quickly add the scallops.</li><li>Cook on high for about 1-2 minutes.</li><li>Flip the scallops and add the butter.  Spoon the butter over the scallops as they cook another 1-2 minutes. Serve over warm greens.</li></ol>",
