      "summary": "Apple Pie Honey Wheat Scones might be just the <b>American</b> recipe you are searching for. This recipe serves 8. One serving contains <b>303 calories</b>, <b>5g of protein</b>, and <b>15g of fat</b>. For <b>49 cents per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. From preparation to the plate, this recipe takes around <b>45 minutes</b>. Head to the store and pick up flour, honey, brown sugar, and a few other things to make it today. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. 8 people found this recipe to be yummy and satisfying. Not a lot of people really liked this breakfast. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 31%</b>. This score is rather bad. <a href=\"https://spoonacular.com/recipes/apple-scones-with-apple-pie-spice-icing-615946\">Apple scones with apple pie spice icing</a>, <a href=\"https://spoonacular.com/recipes/apple-scones-with-apple-pie-spice-icing-616368\">Apple scones with apple pie spice icing</a>, and <a href=\"https://spoonacular.com/recipes/whole-wheat-honey-apple-bundt-cake-601039\">Whole Wheat Honey Apple Bundt Cake</a> are very similar to this recipe.",
