      "summary": "Perfect fish cakes might be a good recipe to expand your main course recipe box. Watching your figure? This pescatarian recipe has <b>417 calories</b>, <b>19g of protein</b>, and <b>25g of fat</b> per serving. For <b>$1.74 per serving</b>, this recipe <b>covers 17%</b> of your daily requirements of vitamins and minerals. This recipe serves 6. This recipe from Foodista requires potatoes, parsley, flour, and salt. This recipe is liked by 16 foodies and cooks. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 60%</b>. This score is good. Similar recipes are <a href=\"https://spoonacular.com/recipes/naomi-duguids-fish-cakes-and-fish-balls-203215\">Naomi Duguid's Fish Cakes and Fish Balls</a>, <a href=\"https://spoonacular.com/recipes/naomi-duguids-fish-cakes-and-fish-balls-1225635\">Naomi Duguid's Fish Cakes and Fish Balls</a>, and <a href=\"https://spoonacular.com/recipes/perfect-fairy-cakes-1086360\">Perfect fairy cakes</a>.",
