      "summary": "If you want to add more <b>gluten free and primal</b> recipes to your recipe box, Zucchini Flutes Piped With Basil Ricotta Mousse might be a recipe you should try. This recipe serves 4 and costs $1.0 per serving. One portion of this dish contains approximately <b>14g of protein</b>, <b>17g of fat</b>, and a total of <b>234 calories</b>. Not a lot of people really liked this side dish. It is brought to you by Foodista. 7 people have tried and liked this recipe. Head to the store and pick up extra virgin olive oil, parmesan cheese, garlic, and a few other things to make it today. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 56%</b>. This score is solid. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/zucchini-with-ricotta-mint-and-basil-597937\">Zucchini with Ricotta, Mint, and Basil</a>, <a href=\"https://spoonacular.com/recipes/fried-zucchini-blossoms-stuffed-with-basil-ricotta-606463\">Fried Zucchini Blossoms Stuffed with Basil Ricotta</a>, and <a href=\"https://spoonacular.com/recipes/grilled-zucchini-rollups-stuffed-with-lemon-basil-ricotta-and-slow-roasted-tomatoes-915698\">Grilled Zucchini Rollups Stuffed with Lemon-Basil Ricottan and Slow Roasted Tomatoes</a>.",
