      "summary": "If you have around <b>45 minutes</b> to spend in the kitchen, Apple Roasted Pork Loin might be an outstanding <b>gluten free, dairy free, paleolithic, and primal</b> recipe to try. For <b>$3.54 per serving</b>, you get a main course that serves 6. One portion of this dish contains around <b>51g of protein</b>, <b>17g of fat</b>, and a total of <b>512 calories</b>. If you have pepper, sea salt, five spice powder, and a few other ingredients on hand, you can make it. Only a few people made this recipe, and 7 would say it hit the spot. It is brought to you by Foodista. Overall, this recipe earns an <b>outstanding spoonacular score of 87%</b>. Similar recipes are <a href=\"https://spoonacular.com/recipes/apple-roasted-pork-loin-1626265\">Apple Roasted Pork Loin</a>, <a href=\"https://spoonacular.com/recipes/roasted-pork-loin-with-apple-onion-dried-plum-stuffing-45905\">Roasted Pork Loin With Apple, Onion & Dried Plum Stuffing</a>, and <a href=\"https://spoonacular.com/recipes/roasted-pork-loin-with-roasted-garlic-vinaigrette-293351\">Roasted Pork Loin with Roasted Garlic Vinaigrette</a>.",
