      "summary": "You can never have too many dessert recipes, so give Chocolate Peppermint Cookies a try. One portion of this dish contains about <b>2g of protein</b>, <b>5g of fat</b>, and a total of <b>129 calories</b>. For <b>17 cents per serving</b>, this recipe <b>covers 3%</b> of your daily requirements of vitamins and minerals. This recipe serves 40. It is perfect for <b>Christmas</b>. 3 people were glad they tried this recipe. From preparation to the plate, this recipe takes about <b>45 minutes</b>. This recipe from Foodista requires baking soda, semi chocolate chips, vanillan extract, and flour. Taking all factors into account, this recipe <b>earns a spoonacular score of 14%</b>, which is not so awesome. Similar recipes include <a href=\"https://spoonacular.com/recipes/chocolate-peppermint-bark-cookies-and-chocolate-peanut-butter-b-35689\">Chocolate Peppermint Bark Cookies And Chocolate Peanut Butter B</a>, <a href=\"https://spoonacular.com/recipes/chocolate-peppermint-cookies-623362\">Chocolate Peppermint Cookies</a>, and <a href=\"https://spoonacular.com/recipes/chocolate-peppermint-cookies-621935\">Chocolate Peppermint Cookies</a>.",
