      "imageType": "jpg",
      "summary": "If you want to add more <b>Mediterranean</b> recipes to your repertoire, Italian Meatloaf with Hard Boiled Eggs might be a recipe you should try. This recipe serves 8. This main course has <b>779 calories</b>, <b>45g of protein</b>, and <b>54g of fat</b> per serving. For <b>$2.67 per serving</b>, this recipe <b>covers 31%</b> of your daily requirements of vitamins and minerals. It is a good option if you're following a <b>dairy free</b> diet. 26 people found this recipe to be flavorful and satisfying. From preparation to the plate, this recipe takes about <b>45 minutes</b>. It is brought to you by Foodista. If you have bacon, onion, butter, and a few other ingredients on hand, you can make it. Overall, this recipe earns a <b>great spoonacular score of 88%</b>. <a href=\"https://spoonacular.com/recipes/instant-pot-hard-boiled-eggs-and-easy-deviled-eggs-960857\">Instant Pot Hard Boiled Eggs (And Easy Deviled Eggs!)</a>, <a href=\"https://spoonacular.com/recipes/son-in-law-eggs-thai-fried-hard-boiled-eggs-in-tamarind-sauce-118666\">Son-in-Law Eggs: Thai Fried Hard-Boiled Eggs in Tamarind Sauce</a>, and <a href=\"https://spoonacular.com/recipes/son-in-law-eggs-thai-fried-hard-boiled-eggs-in-tamarind-sauce-1235491\">Son-in-Law Eggs: Thai Fried Hard-Boiled Eggs in Tamarind Sauce</a> are very similar to this recipe.",
