      "summary": "Mad Men Oysters Rockefeller requires about <b>45 minutes</b> from start to finish. One serving contains <b>390 calories</b>, <b>3g of protein</b>, and <b>36g of fat</b>. For <b>$1.21 per serving</b>, you get a hor d'oeuvre that serves 4. 4 people found this recipe to be yummy and satisfying. If you have parsley, pernod, spinach, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>pescatarian</b> diet. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 38%</b>, which is rather bad. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/cakespy-gingerbread-mad-men-64358\">Cakespy: Gingerbread Mad Men</a>, <a href=\"https://spoonacular.com/recipes/oatmeal-chocolate-chip-cookies-from-mad-hungry-feeding-men-and-boys-575181\">Oatmeal Chocolate Chip Cookies from Mad Hungry: Feeding Men and Boys</a>, and <a href=\"https://spoonacular.com/recipes/oysters-rockefeller-202454\">Oysters Rockefeller</a>.",
