      "summary": "Pumpkin Pecan Streusel Cake - gluten free, soy free, vegan takes around <b>45 minutes</b> from beginning to end. One serving contains <b>550 calories</b>, <b>6g of protein</b>, and <b>20g of fat</b>. This gluten free recipe serves 8 and costs <b>$1.2 per serving</b>. 2 people have made this recipe and would make it again. A mixture of coconut yogurt, kosher salt, firmly brown sugar, and a handful of other ingredients are all it takes to make this recipe so scrumptious. It works well as a reasonably priced dessert. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 40%</b>. This score is solid. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/rich-pumpkin-coffee-cake-gluten-free-vegan-soy-free-43068\">Rich Pumpkin Coffee Cake (gluten-free, Vegan, Soy-free)</a>, <a href=\"https://spoonacular.com/recipes/pumpkin-butter-vegan-gluten-free-nut-free-soy-free-249096\">Pumpkin Butter (Vegan, Gluten-Free, Nut-Free, Soy-Free)</a>, and <a href=\"https://spoonacular.com/recipes/creamy-vegan-corn-and-red-pepper-blender-soup-gluten-free-soy-free-nut-free-grain-free-salt-free-520519\">Creamy Vegan Corn and Red Pepper Blender Soup (gluten-free, soy-free, nut-free, grain-free, salt-free)</a>.",
