      "instructions": "<ol><li>Preheat oven to 350F.</li><li>Grease and flour a 9-inch spring form pan or a 9-inch cake pan with 3-inch sides (recommended by Williams Sonoma). I used an Angel Food Cake Pan.</li><li>For the streusel:</li><li>Combine the flours, brown sugar, cinnamon and kosher salt in a small bowl.</li><li>Add Earth Balance Soy Free Spread into the dry ingredients.</li><li>Work the spread into the mixture with your hands until the mixture looks like coarse crumbs.</li><li>Add the pecans, combine. Set aside.</li><li>For the batter:</li><li>Measure your coconut milk and add the apple cider vinegar to it.</li><li>Let it sit without mixing to become sour-creamy looking. Set aside.</li><li>In a medium bowl, sift together, or whisk the flours, baking powder, baking soda, cinnamon, ginger, nutmeg and kosher salt.</li><li>In the bowl of an electric mixer fitted with the flat beater, beat together the butter and brown sugar on medium-high speed until well combined.</li><li>Add the mashed banana, scraping down the sides of the bowl with a rubber spatula when needed.</li><li>Add the pumpkin puree and sour cream mixture and continue to mix on low speed.</li><li>Add in the flour mixture.</li><li>The batter will be quite thick which is how it should be.</li><li>Note: If your batter is not thick for some reason add 1/4 cup of white rice flour.</li><li>Spread half of the thick batter into the prepared pan.</li><li>Sprinkle half of the streusel over the batter.</li><li>Add the remaining batter over the streusel and spread the thick batter evenly.</li><li>Evenly spread the remaining streusel over the batter.</li><li>Bake 55-60 minutes, or until a toothpick inserted into the center of the cake comes out clean.</li><li>Transfer the cake in the pan to your stovetop and let it cool for about 40 minutes.</li><li>When cooled, remove the sides of the cake from the pan using a spreader type knife, or something that will not scratch your cake pan.</li><li>Gently lift up the cake by pressing the removable bottom upwards.</li><li>I then refrigerated the cake with the bottom part still holding the cake for about an hour.</li><li>Transfer the chilled cake to a cake platter.</li><li>Put pieces of wax or parchment paper under the edges of the cake to keep the glaze drips from making a mess of your platter.</li><li>For the glaze:</li><li>In a glass bowl set over a small saucepan with simmering water, combine mini chips with Earth Balance spread.</li><li>Mix often to get a glossy sheen.</li><li>When completely melted take off the saucepan and let it cool for 5 minutes before glazing the cake.</li><li>Using a large spoon drizzle melted chocolate over the top of the cake.</li><li>Slowly pull out the papers along the cake.</li><li>Serve chilled, or room temperature.</li></ol>",
