      "summary": "Forget going out to eat or ordering takeout every time you crave Mediterranean food. Try making Italian Tomato and Mozzarella Caprese at home. For <b>$1.7 per serving</b>, you get a main course that serves 4. One portion of this dish contains around <b>28g of protein</b>, <b>14g of fat</b>, and a total of <b>269 calories</b>. 2 people were impressed by this recipe. A mixture of fluid balsamic vinegar, kosher salt, olive oil, and a handful of other ingredients are all it takes to make this recipe so yummy. From preparation to the plate, this recipe takes around <b>45 minutes</b>. It is brought to you by Foodista. It is a good option if you're following a <b>gluten free, lacto ovo vegetarian, and primal</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 90%</b>. This score is great. <a href=\"https://spoonacular.com/recipes/italian-tomato-and-mozzarella-caprese-1398881\">Italian Tomato and Mozzarella Caprese</a>, <a href=\"https://spoonacular.com/recipes/tomato-mozzarella-caprese-salad-1462449\">Tomato Mozzarella Caprese Salad</a>, and <a href=\"https://spoonacular.com/recipes/caprese-quesadilla-with-tomato-mozzarella-basil-mayonnaise-584486\">Caprese Quesadilla with Tomato, Mozzarella & Basil Mayonnaise</a> are very similar to this recipe.",
