      "summary": "Moroccan Chicken Tagine is a main course that serves 6. One serving contains <b>224 calories</b>, <b>14g of protein</b>, and <b>6g of fat</b>. For <b>$1.49 per serving</b>, this recipe <b>covers 19%</b> of your daily requirements of vitamins and minerals. 6 people found this recipe to be scrumptious and satisfying. It is brought to you by Foodista. A mixture of flour, almond slivers, canned tomatoes, and a handful of other ingredients are all it takes to make this recipe so tasty. From preparation to the plate, this recipe takes around <b>45 minutes</b>. It is a good option if you're following a <b>dairy free</b> diet. Taking all factors into account, this recipe <b>earns a spoonacular score of 74%</b>, which is pretty good. Similar recipes include <a href=\"https://spoonacular.com/recipes/moroccan-chicken-tagine-264133\">Moroccan Chicken Tagine</a>, <a href=\"https://spoonacular.com/recipes/moroccan-chicken-tagine-124767\">Moroccan Chicken Tagine</a>, and <a href=\"https://spoonacular.com/recipes/moroccan-chicken-tagine-100347\">Moroccan Chicken Tagine</a>.",
