      "summary": "Rosemary Rum Raisin Soda Bread with Pecans is a <b>lacto ovo vegetarian</b> recipe with 16 servings. This breakfast has <b>173 calories</b>, <b>5g of protein</b>, and <b>4g of fat</b> per serving. For <b>44 cents per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. Only a few people really liked this European dish. A mixture of anise seeds, rum, flour, and a handful of other ingredients are all it takes to make this recipe so flavorful. 4 people were impressed by this recipe. It is brought to you by Foodista. From preparation to the plate, this recipe takes about <b>45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 53%</b>, which is solid. <a href=\"https://spoonacular.com/recipes/irish-soda-bread-pudding-with-raisin-jam-81000\">Irish Soda Bread Pudding With Raisin Jam</a>, <a href=\"https://spoonacular.com/recipes/rum-raisin-bread-480407\">Rum Raisin Bread</a>, and <a href=\"https://spoonacular.com/recipes/rum-raisin-cinnamon-bread-611878\">Rum Raisin Cinnamon Bread</a> are very similar to this recipe.",
