      "summary": "Gluten Free Profiteroles takes around <b>45 minutes</b> from beginning to end. This recipe makes 1 servings with <b>800 calories</b>, <b>10g of protein</b>, and <b>75g of fat</b> each. For <b>$1.22 per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. 4 people were impressed by this recipe. It works well as a rather inexpensive side dish. A mixture of water, sugar, salt, and a handful of other ingredients are all it takes to make this recipe so flavorful. It is a good option if you're following a <b>gluten free and lacto ovo vegetarian</b> diet. It is brought to you by Foodista. With a spoonacular <b>score of 25%</b>, this dish is not so tremendous. Try <a href=\"https://spoonacular.com/recipes/thousand-island-dressing-gluten-free-corn-free-dairy-free-soy-free-nut-free-gum-free-and-refined-sugar-free-512186\">Thousand Island Dressing (Gluten-Free, Corn-Free, Dairy-Free, Soy-Free, Nut-Free, Gum-Free and Refined Sugar-Free)</a>, <a href=\"https://spoonacular.com/recipes/gluten-free-vegan-walnut-and-oat-brownies-vegan-gluten-free-grain-free-flourless-dairy-free-no-refined-sugar-617963\">Gluten-Free Vegan Walnut and Oat Brownies (Vegan, Gluten-Free, Grain-Free, Flourless, Dairy-Free, No Refined Sugar)</a>, and <a href=\"https://spoonacular.com/recipes/gluten-free-vegan-walnut-and-oat-brownies-vegan-gluten-free-grain-free-flourless-dairy-free-no-refined-sugar-1356583\">Gluten-Free Vegan Walnut and Oat Brownies (Vegan, Gluten-Free, Grain-Free, Flourless, Dairy-Free, No Refined Sugar)</a> for similar recipes.",
