      "instructions": "<ol><li>Preheat oven to 375F.</li><li>Sift the flour, xantham gum, salt and sugar together 3-4 times, set aside in a handy location close to the stove.</li><li>Break egg into a measuring cup and whisk to combine. Set aside.</li><li>Prepare your hand mixer so that it is ready when needed.</li><li>Measure milk and water into a deep heavy bottomed pan. Cut butter into smallish chunks and add them into the milk mixture. Heat gently until all the butter has melted.</li><li>Increase heat on the butter milk mixture until is comes to a rolling boil.</li><li>Remove from heat and pour flour mixture into the milk mixture all at once. Beat vigorously with a wooden spoon.</li><li>Return to a low heat and continue beating with the wooden spoon until the flour forms a smooth paste and has come cleanly off all the sides and bottom (should be shiny and smooth). The recipe says to avoid over cooking this paste as the buns will become heavy.</li><li>Remove from heat and slowly pour the egg into the mixture, beating well with the hand mixer, being careful to to make the paste too runny (the recipe indicates that the amount of egg required depends on the humidity, so add in smallish quantities). Continue to beat until shiny and stiff. The paste should firm but elastic and should be able to stand on its own when dropped by spoonfuls. This paste may be kept for a couple of hours covered with a damp cloth. Also, the recipe indicates that this paste can be frozen and used successfully (next time I will freeze excess balls individually on a cookie sheet, and bake individually as required in the future!).</li><li>Prepare a cookie sheet by running it under cold water, shaking excess water off, but leaving it damp. Use two baking sheet to protect the bottom of each puff from burning.</li><li>Place tablespoons of the mixture about 10 cm apart (the chous will double to triple in size).</li><li>Bake for 20-25 minutes, until the exterior is golden  do NOT open the oven for the first 15 minutes. Chou needs to be golden otherwise they will collapse as cooling. All sides must be golden brown, if not, the inside has not finished baking and they WILL collapse!</li><li>When done, remove from the sheet to a baking rack, piercing with a toothpick to allow steam to escape. Chou pastry may be reheated for about 10 minutes to crisp them up again.</li></ol>",
