      "instructions": "<ol><li>Heat up butter, add onion and fry till fragrant. Add in carrot and chicken cubes, fry well and add seasoning.</li><li>Sprinkle 1 tbsp plain flour over it, stir well and add chicken stock. Bring mixture to boil, turn off heat and add spring onion and a dash of pepper, mix well and set aside to cool.</li><li>In the mixing bowl put all the ingredients into it except melted butter and whisk at maximum speed till batter becomes thick and white.</li><li>Lower speed and gradually add in melted butter or canola oil, mix well.</li><li>Line cake pan with non stick baking paper at the bottom and grease some butter at the sides of the pan. Add cooked chicken mixture into the two pans evenly, then pour batter into it.</li><li>Bake at preheated oven at 180 degrees for 25 - 30 minutes or skewer into the center of the cake and comes out clean.</li><li>Remove the cakes immediately from the pans after baked and place on wire rack.</li><li>Best to serve warm.</li></ol>",
