      "summary": "Colorful Red Quinoa Not So Tabbouleh Salad requires around <b>45 minutes</b> from start to finish. For <b>$1.4 per serving</b>, this recipe <b>covers 21%</b> of your daily requirements of vitamins and minerals. This hor d'oeuvre has <b>283 calories</b>, <b>8g of protein</b>, and <b>14g of fat</b> per serving. This recipe serves 4. 2 people have tried and liked this recipe. This recipe is typical of middl eastern cuisine. This recipe from Foodista requires red wine vinegar, water, salt, and cayenne pepper. It is a good option if you're following a <b>gluten free, dairy free, lacto ovo vegetarian, and vegan</b> diet. With a spoonacular <b>score of 87%</b>, this dish is super. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/colorful-red-quinoa-not-so-tabbouleh-salad-1212333\">Colorful Red Quinoa Not So Tabbouleh Salad</a>, <a href=\"https://spoonacular.com/recipes/colorful-quinoa-salad-272775\">Colorful Quinoa Salad</a>, and <a href=\"https://spoonacular.com/recipes/colorful-quinoa-salad-1273033\">Colorful Quinoa Salad</a>.",
