      "instructions": "<ol><li>Preheat oven to 350F.</li><li>Butter 9x2-inch round cake pan.</li><li>Pat slices of mango dry with paper towels.</li><li>In small bowl, stir together butter and brown sugar and spread evenly in pan. Arrange mango pieces from two mangos on the sugar mixture.</li><li>Reserve the rest for mango puree and set aside.</li><li>In food processor, puree remaining mangos to make  cup.</li><li>Into small bowl sift together the flour, baking powder, salt and cinnamon.</li><li>In another bowl with electric mixer, cream butter and sugar until mixture is light and fluffy.</li><li>Add eggs, one at a time, beating well after each addition.</li><li>Beat in vanilla.</li><li>Add flour mixture alternately in batches with pureed mangos.</li><li>Beginning and ending with flour mixture and beating well after each addition. Pour batter into pan, spreading evenly.</li><li>Bake cake in middle of oven for 45 to 55 minutes, or until it tests done.</li><li>Let cake cool in the pan on a rack for 15 minutes.</li><li>Run a thin knife around the edge and invert onto a platter.</li></ol>",
